import React from 'react';
import BookItem from './BookItem';

const BookList = ({ books, onEdit, onDelete }) => (
  <div>
    {books.map((book) => (
      <BookItem key={book._id} book={book} onEdit={onEdit} onDelete={onDelete} />
    ))}
  </div>
);

export default BookList;
